import java.io.BufferedReader;
import java.io.InputStreamReader;
import java.util.ArrayList;
import java.util.stream.Collectors;

public class GoodMemories {

    public static void main(String[] args) {
        BufferedReader reader = new BufferedReader(new InputStreamReader(System.in));
        ArrayList<String> input = reader.lines().collect(Collectors.toCollection(ArrayList::new));
        int x = Integer.parseInt(input.get(0));

        // Excusion list stored in array list.
        ArrayList<Excursion> exlist = new ArrayList<>();
        for (int i = 1; i < input.size() - 1; ) {
            int n = Integer.parseInt(input.get(i));
            Excursion xx = new Excursion(n);
            for (int j = 0; j < n; j++) {
                String[] tmp = input.get(i + j + 1).split(",");
                ArrayList<String> tmp2 = new ArrayList<>();
                for (int k = 0; k < tmp.length; k++) {
                    tmp2.add(tmp[k]);
                }
                xx.visited.add(tmp2);
            }
            exlist.add(xx);
            i = n + i + 1;
        }
        // Print excursion lists.
        exlist.forEach(
                (m) -> {
                    boolean[] memory = new boolean[m.n];
                    System.out.println(m.visited);
                    excheck(m.visited, memory, memory.length - 1);
                    for (int i = 0; i < memory.length; i++) {
//                        System.out.println(memory[i]);
                        if (memory[i] == false) {
                            System.out.println("ORDER VIOLATION");
                            return;
                        }
                        System.out.println("ORDER EXISTS");
                        break;
                    }
                }
        );

    }

    public static void excheck(ArrayList<ArrayList<String>> visited, boolean[] memory, int index) {
//        System.out.println(visited.get(index));
        ArrayList<String> remover = visited.get(index);
        for (int k = 0; k < visited.get(index).size(); k++) {
            for (int i = 0; i < memory.length; i++) {
//                System.out.println(visited.get(i));
                int index2remove = visited.get(i).indexOf(remover.get(k));
                if (index2remove != -1) {
                    memory[i] = true;
                    try {
                        if (index > 1) {
                            excheck(visited, memory, index - 1);
                        }
                    } catch (Exception ex) {

                    }
                }
            }
        }
    }


    public static class Excursion {
        int n; // friends;
        ArrayList<ArrayList<String>> visited = new ArrayList<>();

        Excursion(int n) {
            this.n = n;
        }
    }

}

